import React from 'react'
import { Route,Routes } from 'react-router-dom'
import { Teams } from '../pages/teams'
export const MainRoutes = () => {
  return (
    <div>
        <Routes>
            <Route path='/teams' element={<Teams/>}></Route>
            <Route path='/:' element={<Teams/>}></Route>
        </Routes>

    </div>
  )
}
